  false,\n\t\"url\": null,\n\t\"notes\": \"EM300 and EM3002D multibeam Data were collected
  in 10-13 Feb. and 18 Feb-13 Mar 2006 aboard NOAA Ship Hi'ialakai in American Samoa
  at Swains Island, Tutuila, the Manu'a Group, Muli Seamount (also known as East Bank),
  Tulaga Seamount (also known as Southwest Bank), Vailulu'u Seamount and Rose Atoll
  during cruise HI-06-02 These multibeam data were collected using SAIC ISS-2000 software
  in the Generic Sensor Format and processed using SABER editing software. Surface
  sound velocity values were supplied by a Seabird SBE-45 MicroTSG and a SBE-38 remote
  temperature probe. Sound velocity corrections from a Seabird 911 CTD sensor and
  motion corrections from a POS-MV vertical reference were applied to the data in
  real time. Predicted tides were applied to the data in real time: at Tutuila, Muli,
  Tulago, Vailulu'u and the Manu'a Islands, Pago Pago (170000) predicted tides were
  used with no corrections; at Rose Atoll, Pago Pago tides were used with +0.1 hr
  time correction and a range ratio of 0.92; and at Swains Island, Pago Pago predicted
  tides were used with a -0.5 hr time correction and a 1.12 range ratio. Horizontal
  accuracy is 20m (no differential GPS correctors applied), vertical accuracy is depth
  dependent (~1% of water depth). WGS84 datum. These data are not to be used for navigation.
  Depths mapped range from 20 - 4800 m. Concurrent mapping was done by the R/V AHI
  in water depths ranging from 10-250 m with the data set being AHI-06-02; metadata
  for AHI-06-02 are submitted separately.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
